    /**
     * Returns a human-readable summary for the given validation problem.
     * @param problem
     */
    summary(problem) {
        let summary = PROBLEM_SUMMARIES[problem.errorCode];
        if (summary === null || summary === undefined || summary === "") {
            summary = problem.message;
        }
        return summary;
    }
